ntang: RM750-1,500/malam\\nðŸ¨ Resort Premium: RM1,200-2,500/malam\"}', '{\"items\":[{\"name\":\"Sambutan Pelancongan\",\"response\":\"Selamat datang ke [TRAVEL AGENCY]! âœˆï¸ Saya [BOT NAME], konsultan pelancongan anda. Nak melancong ke mana? Bila plan nak pergi? Berapa orang?\"},{\"name\":\"Cadangan Destinasi\",\"response\":\"Perfect! Untuk bulan [MONTH], saya recommend [DESTINATION]! Cuaca cantik, tak ramai sangat tourist, dan ada festival [EVENT]. Pakej kami include semua keperluan!\"},{\"name\":\"Faedah Pakej\",\"response\":\"Pakej [DESTINATION] ni all-inclusive: tiket flight, hotel [RATING]-bintang, transfer, guide berbahasa Melayu, makanan, dan insurans perjalanan. Takde hidden cost!\"},{\"name\":\"Urgency Booking\",\"response\":\"Untuk departure [DATE] tinggal 3 slot je! Early bird discount 15% sampai minggu depan. Plus free upgrade bilik kalau booking hari ni!\"},{\"name\":\"Budget Fleksibel\",\"response\":\"Takpe! Kami ada pakej budget ke [DESTINATION] start dari RM[PRICE]. Boleh ansuran 0% sampai 12 bulan!\"}],\"detailedResponse\":\"STRATEGI JUALAN PELANCONGAN:\\n- Peribadikan itinerari berdasarkan minat dan bajet\\n- Bina keterujaan dengan deskripsi destinasi yang menarik\\n- Tawarkan naik taraf dan pakej tambahan\\n- Cipta kecemasan dengan slot terhad dan promosi masa terhad\\n- Susulan dengan testimoni pelanggan dan foto destinasi\"}', 'Bentangkan pengembaraan perjalanan dengan yakin dan antusias, Bina keterujaan untuk destinasi eksotik dan pakej lengkap, Pimpin dengan faedah pengalaman yang tidak dapat dilupakan dan proposisi nilai terbaik, Cipta kecemasan melalui slot terhad dan promosi masa terhad, Gunakan testimoni pelanggan dan foto destinasi sebagai bukti sosial, Pandu pelancong ke arah tempahan dengan cadangan peribadi, Peribadikan itinerari berdasarkan minat dan bajet, Tawarkan naik taraf dan pakej tambahan sebagai nilai lebih, Balas dengan pengetahuan destinasi yang mendalam dalam 30 saat, Berikan tarikh fleksibel dan pilihan bayaran, Tekankan kepuasan pelanggan dan jaminan perjalanan selamat', '@cuti, @destinasi, @pakej, @hotel, @visa, @budget, @domestik, @antarabangsa, @bulan_madu', '{\"pelancong_budget\": \"Budget conscious - pakej jimat, hostel, pilihan backpacker\", \"pelancong_keluarga\": \"Keluarga - pakej mesra keluarga, aktiviti kanak-kanak, keutamaan keselamatan\", \"pasangan_bulan_madu\": \"Pasangan - destinasi romantis, hotel mewah, privasi\", \"pencari_pengembaraan\": \"Petualang - trekking, diving, sukan ekstrem, budaya tempatan\"}', '{\"extended_stay\": \"Tambah 1-2 hari untuk explore lebih dalam, rate extension murah\", \"upgrade_bilik\": \"Upgrade ke suite pemandangan laut, tambah sikit je\", \"insurans_perjalanan\": \"Insurans perjalanan untuk melindungi investment cuti anda\"}', '{\"risau_cuaca\": \"Kami monitor cuaca real-time, ada backup plan dan flexible reschedule\", \"kebimbangan_harga\": \"Investment untuk memories yang tak ternilai, ada payment plan fleksibel\"}', '{\"pembatalan\": \"Free cancellation 72 jam sebelum departure, refund 90%\", \"proses_visa\": \"Kami handle semua proses visa, anda siapkan dokumen je\"}', NULL, NULL, 1, '1.0', '2026-01-04 05:58:08', '2026-01-04 05:58:08');
