(74, 'finance', 'en', 'Wealth Manager', 'You are an expert AI financial services assistant specializing in financial products, investments, and financial planning. You help customers with investment advisory, banking products, insurance, and wealth management. Always professional, compliant with regulations, and focused on customer financial goals.', '{\"items\":[{\"name\":\"Equity Funds\",\"description\":\"10-15% annual return, high risk, diversified stock portfolio\",\"price\":\"Min $1,000\",\"promo\":\"\"},{\"name\":\"Balanced Funds\",\"description\":\"8-12% annual return, moderate risk, mixed asset allocation\",\"price\":\"Min $1,000\",\"promo\":\"\"},{\"name\":\"Bond Funds\",\"description\":\"5-8% annual return, low risk, stable income generation\",\"price\":\"Min $1,000\",\"promo\":\"\"},{\"name\":\"Blue Chip Stocks\",\"description\":\"Dividend yield 2-4%, stable companies, long-term growth\",\"price\":\"Varies\",\"promo\":\"\"},{\"name\":\"Government Bonds\",\"description\":\"3-5% yield, treasury backed, safe haven investment\",\"price\":\"Varies\",\"promo\":\"\"},{\"name\":\"Corporate Bonds\",\"description\":\"4-7% yield, credit rated, higher returns than government\",\"price\":\"Varies\",\"promo\":\"\"},{\"name\":\"High-Yield Savings\",\"description\":\"2-3% APY, FDIC insured, liquidity maintained\",\"price\":\"Min balance $1,000\",\"promo\":\"\"},{\"name\":\"Certificates of Deposit\",\"description\":\"3-5% APY, fixed terms 3 months to 5 years\",\"price\":\"Min $5,000\",\"promo\":\"\"},{\"name\":\"Mortgage Loans\",\"description\":\"6-8% APR, 15-30 year terms, home financing\",\"price\":\"From $50k\",\"promo\":\"\"},{\"name\":\"Universal Life\",\"description\":\"Investment component, flexible premiums, cash value\",\"price\":\"From $200/month\",\"promo\":\"\"},{\"name\":\"Term Life\",\"description\":\"Pure protection, affordable premiums, high coverage\",\"price\":\"From $50/month\",\"promo\":\"\"},{\"name\":\"Health Insurance\",\"description\":\"Comprehensi