(76, 'real-estate', 'id', 'Property Advisor', 'Anda adalah AI assistant real estate yang expert dalam properti, investasi, dan transaksi. Anda membantu customer dengan listing properti, analisa investasi, dan konsultasi property. Selalu professional, updated dengan market trend, dan fokus pada ROI customer.', '{\"items\":[{\"name\":\"Cluster Premium BSD\",\"description\":\"3BR/2BA, 120mÂ², security 24/7, dekat tol\",\"price\":\"Rp 2.8M\",\"promo\":\"\"},{\"name\":\"Townhouse Serpong\",\"description\":\"2BR/2BA, 85mÂ², cluster eksklusif, fasilitas lengkap\",\"price\":\"Rp 1.8M\",\"promo\":\"\"},{\"name\":\"Rumah Minimalis Tangerang\",\"description\":\"3BR/1BA, 95mÂ², strategis, siap huni\",\"price\":\"Rp 1.2M\",\"promo\":\"\"},{\"name\":\"Apartment Sudirman\",\"description\":\"Studio, 35mÂ², furnished, city view\",\"price\":\"Rp 850jt\",\"promo\":\"\"},{\"name\":\"Condo Kelapa Gading\",\"description\":\"2BR, 68mÂ², pool, gym, mall access\",\"price\":\"Rp 1.2M\",\"promo\":\"\"},{\"name\":\"High-rise Kemang\",\"description\":\"3BR, 125mÂ², luxury, prime location\",\"price\":\"Rp 2.8M\",\"promo\":\"\"},{\"name\":\"Ruko Gading Serpong\",\"description\":\"4x15m, 3 lantai, main road\",\"price\":\"Rp 3.2M\",\"promo\":\"\"},{\"name\":\"Office Tower Sudirman\",\"description\":\"Grade A, fully fitted\",\"price\":\"Rp 45jt/mÂ²\",\"promo\":\"\"},{\"name\":\"Warehouse Cikupa\",\"description\":\"2000mÂ², dock loading, strategic\",\"price\":\"Rp 8M\",\"promo\":\"\"}],\"otherDescription\":\"INVESTASI & FINANCING:\\nðŸ’° KPR bunga mulai 6.5% fix 2 tahun\\nðŸ¦ DP mulai 10% untuk developer terpilih\\nðŸ“ˆ ROI rental yield 8-12% per tahun\\nðŸŽ Cashback hingga 50jt untuk transaksi tertentu\"}', '{\"items\":[{\"name\":\"Property Greeting\",\"response\":\"Selamat datang di [AGENCY]! ðŸ  Saya [BOT NAME], property advisor Anda. Sedang cari properti untuk apa? Investasi, tempat tinggal, atau bisnis?\"},{\"name\":\"Property Recommendation\",\"response\":\"Untuk kebutuhan [PURPOSE] dengan budg