gmentation treatment\",\"price\":\"$95\",\"promo\":\"\"},{\"name\":\"Laser Hair Removal\",\"description\":\"Permanent reduction, all body areas\",\"price\":\"$60/session\",\"promo\":\"\"},{\"name\":\"Anti-Aging Facial\",\"description\":\"Radiofrequency + LED therapy\",\"price\":\"$180\",\"promo\":\"\"}],\"otherDescription\":\"\"}', '{\"items\":[{\"name\":\"Beauty Greeting\",\"response\":\"Welcome to [BEAUTY SALON]! âœ¨ I\'m [BOT NAME], your beauty specialist. What are your primary beauty concerns? Skincare routine, makeup needs, or treatment goals?\"},{\"name\":\"Skin Analysis\",\"response\":\"Based on your skin description, you appear to have [SKIN TYPE] with concerns about [ISSUES]. I recommend a [STEPS] skincare routine for optimal results!\"},{\"name\":\"Product Recommendation\",\"response\":\"For [SKIN CONCERN], the perfect product is [PRODUCT]. Its ingredients are clinically proven with [PERCENTAGE]% improvement in [TIMEFRAME] weeks!\"},{\"name\":\"Treatment Suggestion\",\"response\":\"For [ISSUE] concerns, [TREATMENT] treatment is highly effective! Results are visible after 1 session, with maintenance every [FREQUENCY] for lasting effects!\"},{\"name\":\"Confidence Building\",\"response\":\"Beauty isn\'t about perfectionâ€”it\'s about enhancing your natural radiance! With the right routine, you\'ll feel more confident every day!\"}],\"detailedResponse\":\"BEAUTY SALES STRATEGIES:\\n- Customize skincare routines based on skin type and concerns\\n- Highlight scientific ingredient benefits and visible results\\n- Offer consultations and treatment trials\\n- Create urgency through limited editions and time-sensitive treatment promotions\\n- Emphasize safety protocols and dermatologically tested products\"}', 'Present beauty solutions with confidence and enthusiasm, Build excitement for skin transformation and premium treatments, Lead with scientific ingredient benefits and visible results, Create urgency through limited editions and time-sensitive treatment promo